Jeff Beck (1944-2023) at his finest. Nobody had a sound or a soul to match what he had. His solo on this track is the musical equivalent of the sun breaking through clouds. It only takes the first 2 notes and you’re on a magic carpet of sound, soaring across the sky on the Jeff-stream. There’s never going to be another voice like his on any instrument. He was truly amazing. When I asked Jeff to play this solo for my album cut “Driftin’“ by Jimi Hendrix I was blown away that he said yes, but once I heard the solo, I was literally on my knees crying, as I replayed it over and over again in disbelief..I’m so proud of this project, produced by Chris Hajian and myself. Thanks to Ben Sidran & Yoshinari Nobu at Go Jazz/Polystar  #thisboyslife 
