Last night in NYC: The genius of Stephen Sondheim was on full display at the Lunt-Fontanne in NYC. Josh Groban does a killer Sweeney Todd and Annaleigh Ashford as Mrs. Lovett. “Hamilton” director Thomas Kail is at the helm. The orchestra is 26 pieces strong and none other than Alex Lacamoire was conducting. I ran into my dear pal Rob Mathes, his wife Tammy & daughter Emma. Here’s small snippet of the lyrics inside “A Little Priest”

“TODD: What is that? 
LOVETT: It's fop. Finest in the shop.
And we have some shepherd's pie peppered
With actual shepherd on top! 
And I've just begun --
Here's the politician, so oily, it's served with a doily, 
Have one! “
